	(13, 'HOUSEM', 'site_main', '6805aa23b54fb1.98361025.jpg', '', '_none', 'Y', '하우스맨은 중개보수를 쉐어하지 않습니다.', 2, 'Y', NULL, NULL, '2025-04-21 11:14:59', '그래서 더 많은 중개사가 움직이고, <br>공실은 더 빨리 사라집니다.', '', '');
